import React from 'react';
import Navbar from '../navbar/navbar';
import Layout from '../layout/layout';
import styles from './style.scss'


class Home extends React.Component {
    constructor(){
        super();
        this.state = {
           username: '',
           password: '',
           latitude: 0,
           longitude: 0,
           photo: '',
           food: '',
           gender: '',
           age: 0,
           redirect: false
        }

    }

    componentDidMount() {
        this.setState({
            username: this.props.userData.username,
            password: this.props.userData.password,
            latitude: this.props.userData.latitude,
            longitude: this.props.userData.longitude,
            photo: this.props.userData.photo,
            food: this.props.userData.food,
            gender: this.props.userData.gender,
            age: this.props.userData.age
        })
    }



  render() {
      console.log('Login state', this.state);
      console.log('userData', this.props.userData);

    return (
        <Layout>
            <Navbar />
            <div class="container">
              <h3>Profile Page</h3>
              <div style={{'height':'300px', 'width':'500px','border':'1px solid black', 'padding': '10px'}}>
              <img style={{'height':'200px', 'width':'200px', 'border':'1px solid black', 'float':'left','padding': '10px', 'margin': '30px'}} src={this.state.photo} alt="fail to load" />
                  <div style={{'border':'1px solid black', 'float':'left','padding': '10px', 'margin': '10px'}} >
                  Name: <span>{this.props.userData.username}</span><br/>
                  Age: <span>{this.props.userData.age}</span><br/>
                  Gender: <span>{this.props.userData.gender}</span><br/>
                  Food I love: <span>{this.props.userData.food}</span><br/>
                  </div>
              </div>

            </div>
        </Layout>
    );
  }
}

export default Home;
